    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
  <Title/>
  <Avatar/>
      </header>
    </div>
  );
}

class Title extends React.Component{
  render(){
    return(
      <div>
       <p> REACT JS</p>
      </div>
    )
  }
}
class Avatar extends React.Component{
  render(){
    return(
      <div>
        <img src="qwe/1.jpg"/>
      </div>
    )
  }
}

export default App;
